retrieval.html.body:
获取数据
有时候您可能只是想获取数据而不是做断言，例如利用 Rize 和 puppeteer 爬虫。
所有能返回数据的方法都会返回经过 Promise 包装的值。也就是说，它们是异步的。我们建议您使用 ES2017 的 async/await 语法。
页面标题和内容
获取标题很简单：
(async () => {
  const rize = new Rize()
  const title = await rize.title()
})()

还有文本内容：
(async () => {
  const rize = new Rize()
  const text = await rize.text()
})()

text 方法有一个可选的参数，您可以传递一个 CSS 选择器，它表示从对应的元素中获取文本。这个参数的默认值是 body。
获取 HTML 内容：
(async () => {
  const rize = new Rize()
  const html = await rize.html()
})()

html 方法同样有一个可选的参数，您可以传递一个 CSS 选择器，它表示从对应的元素中获取 HTML。这个参数的默认值是 html，这意味着获取整个 HTML 文档。
页面信息
Rize 还提供了一些可以获取当前页面信息的方法。
您可以获取 URL：
(async () => {
  const rize = new Rize()
  const url = await rize.url()
})()

还有 query string：
(async () => {
  const rize = new Rize()
  const value = await rize.queryString('key1')
})()

还有 cookie(s)：
(async () => {
  const rize = new Rize()
  const cookie = await rize.cookie()    // 只获取一个 cookie
  const cookies = await rize.cookies()  // 获取包含 cookies 的数组
})()

元素
通过使用 attribute, style, value 和 hasClass 方法，您可以很方便地获取元素的数据：
(async () => {
  const rize = new Rize()

  // 获取属性
  const value = await rize.attribute('input', 'value')

  // 获取样式
  const fontSize = await rize.style('div', 'font-size')

  // 获取值。这等同于 `rize.attribute(/* 选择器 */, 'value')`
  const val = await rize.value('input')

  // 获取某个元素是否包含某个 class
  const hasMyClass = await rize.hasClass('div', 'my-class')
})()

不过，value 方法可以接收第二个参数。当您传递第二个参数，它将设置该元素的值而不是获取值，同时返回当前的 Rize 实例，不是 Promise。
const rize = new Rize()
rize.value('input', 'new-value')
// ... 这里可以使用可链式调用的方法

您还可以获知一个元素是否可见或存在：
(async () => {
  const rize = new Rize()
  const visible = await rize.isVisible('div')
  const present = await rize.isPresent('canvas')
})()

其它方法
前往这个页面可以查看全部的方法。

faq.html.body:
FAQ
为什么叫 “Rize”?
“Rize” 是《请问您今天要来点兔子吗？》中的一个角色。
她全名是“天天座理世”，日语写作“リゼ”。
所以 “Rize” 的发音是 /ɾize/，而不是 /raɪzɪ/.
你为什么会创建这个库？
Puppeteer 在控制 Chromium/Chrome 方面干得很好，我们也可以利用 puppeteer 来做爬虫、自动化 UI 测试等等。然而，编写使用 puppeteer 的代码并不优雅、并不简单。
下面是一个直接使用 puppeteer 的例子：
const puppeteer = require('puppeteer')
void (async () => {
  const browser = await puppeteer.launch()
  const page = await browser.newPage()
  await page.goto('https://github.com')
  await page.screenshot({ path: 'github.png' })
  await browser.close()
})()

正如您所见，puppeteer 的大多数的操作是异步的。因此我们必须使用 ES2017 的语法 async/await。（你说使用 Promise？那只会让代码变得难以阅读！）
这还只是一个小小的例子。要是在一个大项目里，将会满是 await 关键字。
这就是我创建这个库的原因。并且受到了 jQuery 和 Laravel Dusk 的启发。
现在来看看使用 Rize 的例子：
const Rize = require('rize')
const rize = new Rize()
rize
  .goto('https://github.com')
  .saveScreenshot('github.png')
  .end()

不再有多余的代码，同时变得优雅！
另外，这个库还提供了一些有用的用于测试的断言方法，例如 assertUrlIs。
我还能访问 puppeteer 的浏览器实例并且调用 puppeteer 的 API 吗？
当然可以！
Rize 并不会阻止您调用 puppeteer 所有可用的方法。您只需要访问 Rize 实例上的 browser 或 page 属性：
const Rize = require('rize')
const rize = new Rize()
rize.browser  // 这等同于 puppeteer.Browser
rize.page     // 这等同于 puppeteer.Page

我可以将这个库和其它的测试框架一起使用吗（例如 Jest、 mocha 等等）？
您可以使用任何您喜欢的测试框架。
对于 Jest 用户
我们推荐使用 Jest。您不需要修改任何配置。
对于 Mocha 用户
您不需要修改任何配置。
不过，由于 Mocha 的限制，您不能同时使用 done 回调和 async/await。
您应该像下面这样做：
describe('some tests', () => {
  it('a test', async () => {
    const rize = new Rize()
    // 做点别的……
    await rize.end()
  })
})

下面是个反面例子：
describe('some tests', () => {
  it('a test', async done => {
    const rize = new Rize()
    // 做点别的……
    rize.end(done)
  })
})

对于 AVA 用户
您应该在 package.json 中把 failWithoutAssertions 设为 false。
